import React from 'react';

import { Route } from "react-router-dom";



function App() {

    return (
        <>
            <Route path="/" component={<h1>hello Rooot</h1>} />
            <Route path="/movie"  component={<h1>he</h1>} />
        </>
    );
}
export default App;
